import React from 'react';
import {Link} from 'react-router-dom'

const Navbar = ({title}) =>{

        return (
            <nav className="navbar  bg-primary">
            <h1>
             {title}
            </h1>
            <ul>
                <li>
                <Link to='/about'>About</Link>
                </li>
                <li>
                <Link to=''>Projects</Link>
                </li>
                <li>
                <Link to='/'>Home</Link>
                </li>
            </ul>
          </nav>
        )

}

 Navbar.defaultProps={
  title:'Dian CHEN'
};

export default Navbar
